export default (function(a,b,c,d,e){return {data:{GJDSTOWEPO:{data:{id:1995,attributes:{imdbId:"tt0084455",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTg2MjUxNjk5NV5BMl5BanBnXkFtZTcwMjEzMzU1MQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"2.9\u002F10"}],item_lang:{data:{id:2658,attributes:{title:e,plot:"In this largely avant-garde feature film, Rex is the member of a group of underground revolutionaries with an unknown agenda who receive their orders from picking letters out of a bowl of alphabet soup. Rex and his companion Nixie travel across the country and change their names with each stage of the story (the stages are separated by a countdown of numbers from 10 to 0). They begin in New York City and strive to make it to Los Angeles. Their adventures, misadventures and often bizarre happenstances form the bulk of the narrative.",slug:"out"}}},books:{data:[{id:1315,attributes:{title:"Up",description:"The author himself is the main character of this book, in which he glides undisturbed from present to future, from reality to fantasy. Sometimes he's an adolescent Brooklynite, at other times a part-time English teacher, a struggling writer living in a Lower East Side tenement, or a fantasist deftly moving in and out of numerous alter egos. **Lightning Print On Demand Title",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tb6AZCNgOnoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"1998-01-01",publisher:d,subtitle:"A Novel"}},{id:1316,attributes:{title:"The Death of the Novel and Other Stories",description:"Originally published in 1969, The Death of the Novel and Other Stories remains among the most memorable creations of an unforgettable age. Irrepressibly experimental in both content and form, these anti-fictions set out to rescue experience from its containment within artistic convention and bourgeois morality. Equal parts high modernist aesthete and borscht belt comedian, Sukenick joins avant-garde art with street slang and cartoons, expressing his generation's anxieties by simultaneously mocking and validating them. These are original works by a writer who will try absolutely anything.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cPOyKMWTjzQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2003-01-01",publisher:d,subtitle:a}},{id:1317,attributes:{title:"In Form, Digressions on the Act of Fiction",description:"Argues that fiction must be freed from stale formulas in order to reflect the complexity of the contemporary world",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=T5lZAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1985-01-01",publisher:a,subtitle:a}},{id:1318,attributes:{title:e,description:a,thumbnail:a,authors:[b],firstBook:c,published:"1996-09-01",publisher:"In Press",subtitle:a}},{id:1319,attributes:{title:"The Endless Short Story",description:"Interconnected, avant-garde stories offer a fresh look at the contradictions and eccentricities of modern life",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vJPynXN8VfgC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1986-01-01",publisher:d,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940949036}}("","Ronald Sukenick",null,"University of Alabama Press","Out"))